        <tr>
            <td>
                {menu.first}
            </td>
            <td>
                {menu.second}
            </td>
            <td>
                {user.theth}
            </td>
        </tr>
    )
}

const UserList = ({users}) => {
    return (
        <table>
            <th>
                Имя
            </th>
            <th>
                Фамилия
            </th>
            <th>
                Логин
            </th>
            {users.map((user) => <UserItem user={user} />)}
        </table>
    )
}

export default UserList
